import axios from "axios";
import {useState} from 'react';
function Excuser() {
    return (
    <>
        <p>Input Category for which you want to find excuse for. These are the list of categories available</p>
        <ul>
            <li>Family (id range 1-10)</li>
            <li>Office (id range 101-110)</li>
            <li>Children (id range 201-210)</li>
            <li>College (id range 301-310)</li>
            <li>Party (id range 401-410)</li>
            <li>Funny (id range 501-516)</li>
            <li>Gaming (id range 801-820)</li>
            <li>Unbelievable (id range 601-613)</li>
            <li>Developers (id range 701-715)</li>
        </ul>
        <button></button>
    </>
    );
}
export default Excuser;
